import React from 'react';
import CalendarView from './components/CalendarView';
import './index.css';

function App() {
  return (
    <div className="App p-4">
      <h1 className="text-2xl font-bold mb-4">My Calendar</h1>
      <CalendarView />
    </div>
  );
}

export default App;
